package com.onyx.android.sdk.data;import android.graphics.Typeface;/** * Created by ming on 2016/11/18. */public class FontInfo {    private String id;    private String name;    private Typeface typeface;    private boolean isSelect;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Typeface getTypeface() {        return typeface;    }    public void setTypeface(Typeface typeface) {        this.typeface = typeface;    }}